(69, '1 1/4â€³ Bridle Ring w/ Nail', '<h1>1 1/4&Prime; Bridle Ring w/ Nail</h1>\r\n\r\n<p><strong>Part Number:</strong>&nbsp; WACTBR125</p>\r\n\r\n<p><strong>Std. Box QTY:</strong>&nbsp;100</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Can fit a Ramset, Hilti, and Powers nail guns. &nbsp;Equipped with a .300 x 1-1/4&quot; pin in a 90&deg; angle clip</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Features:</strong></p>\r\n\r\n<ul>\r\n	<li>1.25&Prime; Diameter ring</li>\r\n	<li>1/4-20 threaded ring preassembled to eyelet</li>\r\n	<li>Nail already preloaded for shooting into various surfaces</li>\r\n</ul>\r\n', '11', 'uploads/5b30de7b84552.jpeg', '', 'no', 'no'),
