(73, '5â€³ Distribution Rings', '<p><strong>5&Prime; Distribution Rings</strong></p>\r\n\r\n<p><strong>Part #</strong>&nbsp;WDR500</p>\r\n\r\n<p><strong>Std Box Qty:</strong>&nbsp;50</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Features a die cast aluminum for holding wires and cables for strength and durability. &nbsp;Can be used in cable terminals, ceilings, floors, walls, etc. &nbsp;Rounded, smooth edges prevent damage to cable insulation and jackets</p>\r\n', '12', 'uploads/5b30e416abdb9.jpg', 'uploads/5b30e416abdf6.pdf', 'no', 'no'),
