(79, '2\" Magnetic Bridle Ring, short post', '<p><strong>2&quot; Magnetic Bridle Ring, Short Post</strong></p>\r\n\r\n<p><strong>Part #</strong>&nbsp;WBR200MAG</p>\r\n\r\n<p><strong>Std Qty:</strong>&nbsp;100</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Features a permanent rare earth magnet with a 2&Prime; Diameter ring for securing wires and cables. &nbsp;Can hold up to 107 lbs against 3mm or thicker metal.</p>\r\n', '26', 'uploads/5b30f6bd6acf0.jpeg', '', 'no', 'no'),
(80, '1/4-20 Mounting Magnet', '<p><strong>1/4-20 Mounting Magnet</strong></p>\r\n\r\n<p><strong>Part #</strong>&nbsp;WMAG1420F</p>\r\n\r\n<p><strong>Features:</strong></p>\r\n\r\n<ul>\r\n	<li>Screw stopping feature</li>\r\n	<li>up to 107 lb pull strength (against 3mm or thicker metal)</li>\r\n	<li>Permanent rare earth magnet</li>\r\n</ul>\r\n\r\n<p><strong>Benefits:</strong></p>\r\n\r\n<ul>\r\n	<li>Thin profile helps eliminate a &ldquo;tipping&rdquo; action</li>\r\n	<li>Can be used in lots of areas; industrial, electrical, construction, etc.</li>\r\n	<li>Nickel plated for a higher corrosion resistance</li>\r\n</ul>\r\n\r\n<p><strong>Standard Box Qty: 100</strong></p>\r\n\r\n<p><em>Patent pending</em></p>\r\n', '27', 'uploads/5b30f82c46263.jpg', 'uploads/5b30f82c462a2.pdf', 'no', 'no'),
