(82, 'Hammer on 1/8-1/4â€³, 1/4-20 Thread', '<p>Hammer on 1/8-1/4&Prime;Flange, Keyed 1/4-20 Thread on side and bottom</p>\r\n\r\n<p><strong>Part #</strong>&nbsp;WM24</p>\r\n\r\n<p><strong>Std. Box Qty:</strong>&nbsp;100</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Can hammer onto 1/8&Prime; to 1/4&Prime; Flanges. &nbsp;Has 1/4-20 threads, and slots for a standard 50 lb tensile strength cable tie.</p>\r\n', '28', 'uploads/5b324f3839cfd.jpg', '', 'no', 'no'),
(83, 'Hammer on 5/16\"-1/2\", 1/4-20 Thread', '<p><strong>Hammer on 5/16&quot;-1/2&quot; Flange, 1/4-20 Thread</strong></p>\r\n\r\n<p><strong>Part #</strong>&nbsp;WM58</p>\r\n\r\n<p><strong>Std. Box Qty:</strong>&nbsp;100</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Can hammer onto 5/16&Prime; to 1/2&Prime; Flanges. &nbsp;Has 1/4-20 threads, and slots for a standard 50 lb tensile strength cable tie.</p>\r\n', '28', 'uploads/5b324f863fd92.jpg', '', 'no', 'no'),
(84, 'Batwing/ Multifunction Clip', '<h1>Batwing/ Multifunction Clip</h1>\r\n\r\n<p>Part # WBW34</p>\r\n\r\n<p>Std. Box Qty: 100</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>This multifunction clip can fit on pencil rod all the way up too 3/8&Prime; All threaded rod. &nbsp;Has 1/4-20 and 10-24 keyed thread holes, and a 1/4&Prime; hole.</p>\r\n', '28', 'uploads/5b32541feb83d.jpg', '', 'no', 'no'),
